  false,\n\t\"url\": null,\n\t\"notes\": \"This Master Plan is presented as a plan
  for the use of land for the benefit and preservation of migratory waterfowl and
  other wildlife in Northwestern Pennsylvania. The Master Plan for Erie National Wildlife
  is in three parts: Part II of the Master Plan is contained in this report. Development
  and management of the refuge for primary purposes will create waterfowl hunting
  and opportunities in the vicinity of the refuge, as well as provide surplus upland
  game and big game populations which could be harvested on the refuge.\",\n\t\"license_title\":
